import React from 'react';
import Paper from '@mui/material/Paper';
import PersonIcon from '@mui/icons-material/Person';
import AddCircleIcon from '@mui/icons-material/AddCircle';
import Stack from '@mui/material/Stack';
import axios from 'axios';
import { Button, Icon, Link, TextField, Typography } from '@mui/material';

const LoginForm = () => {

    const getAPI = async ()=>{
        try{
            const result = await axios.get('http://localhost:5000/');
            console.log("Get API Result: ", result.data);            
        }catch(error){
            console.error(error);
        }
    }

    const loginPOST = async (values)=>{
        try{
            console.log("Started with POST API");
            const response = await axios.post("http://localhost:5000/", values);
            console.log(response.data);
        }catch(error){
            console.error("Error observer with loginPOST API", error);
        }
    }

    const onFinish = (values)=>{
        console.log('Success: ', values);
        loginPOST(values);
    }

    const onFinishFailed = (error)=>{
        console.log('Failed: ', error);
    }

   return(
    <Paper className='loginForm' elevation={20}>
        <Stack direction="row" alignItems="center" gap={1}>
            <PersonIcon aria-label='Login' fontSize='medium' color='primary'  />
            <Typography variant='h5'>Login</Typography>
        </Stack>
        <br></br>
        <TextField label='Email Address' name='email' type='text'></TextField>
        <TextField label='Password' name='password' type='password'></TextField>
        <Button type='submit' variant='contained'>Login</Button>
        <Link label='Forgot Password'>Forgot Password</Link>
    </Paper>
   ) 
}

export default LoginForm;
